import {BrowserRouter, Route} from 'react-router-dom'
import ContentMain from './pages/ContentMain'

const Routes = () => {
  return(
    <BrowserRouter>
      <Route exactpath="/" component={ContentMain}/>
      <Route path="/sobre" componet={ContentMain}/> 
    </BrowserRouter>
  )
}

export default Routes
